import{_ as e,c as t,o as r,a3 as i}from"./chunks/framework.zGi9i9Bf.js";const l="/ProgramLearnNotes/assets/640-1715170174347-101.BnUdx3DR.webp",o="/ProgramLearnNotes/assets/640-1715170174347-102.m7CPEP2M.webp",a="/ProgramLearnNotes/assets/640.CVBT-KGJ.webp",s="/ProgramLearnNotes/assets/image-20240508190250881.DkSjpX5o.png",n="/ProgramLearnNotes/assets/640-1715166082478-2.BHOmnq5F.webp",c="/ProgramLearnNotes/assets/640-1713527171317-54.CM-waMRV.gif",p="/ProgramLearnNotes/assets/640-1713527171317-55.D2e95jbA.webp",_=JSON.parse('{"title":"C-C++学习资源","description":"","frontmatter":{},"headers":[],"relativePath":"Document/C-C++/C-C++学习资源.md","filePath":"Document/C-C++/C-C++学习资源.md","lastUpdated":1717759497000}'),h={name:"Document/C-C++/C-C++学习资源.md"},u=i('<h1 id="c-c-学习资源" tabindex="-1">C-C++学习资源 <a class="header-anchor" href="#c-c-学习资源" aria-label="Permalink to &quot;C-C++学习资源&quot;">​</a></h1><h1 id="c学习资源" tabindex="-1">C学习资源 <a class="header-anchor" href="#c学习资源" aria-label="Permalink to &quot;C学习资源&quot;">​</a></h1><p><a href="https://wangdoc.com/clang/" target="_blank" rel="noreferrer">C 语言教程 - 网道 (wangdoc.com)</a></p><p>待定</p><p>C语言算法题：<a href="https://juejin.cn/post/6844903686997540878" target="_blank" rel="noreferrer">数据结构基础和算法题系列总结 - 掘金 (juejin.cn)</a></p><p><a href="https://mp.weixin.qq.com/s/g40lEgypusTxL97eUSGFsw" target="_blank" rel="noreferrer">全面解读curl团队的C语言代码规范 (qq.com)</a></p><p><a href="https://zserge.com/posts/fenster/" target="_blank" rel="noreferrer">最小的跨平台图形 (zserge.com)</a></p><p><a href="https://zhuanlan.zhihu.com/p/483372519" target="_blank" rel="noreferrer">用 gdb 学 C 语言 - 知乎 (zhihu.com)</a></p><h1 id="c语言开源项目" tabindex="-1">C语言开源项目 <a class="header-anchor" href="#c语言开源项目" aria-label="Permalink to &quot;C语言开源项目&quot;">​</a></h1><p>Linux 实用程序，用于将修改键配置为在按下和释放时充当其他键：<a href="https://github.com/alols/xcape" target="_blank" rel="noreferrer">https://github.com/alols/xcape</a></p><p><a href="https://github.com/reactos/reactos" target="_blank" rel="noreferrer">reactos/reactos：一个免费的 Windows 兼容操作系统 (github.com)</a></p><p><a href="https://mp.weixin.qq.com/s?__biz=MzA4NzU0MzU2MA==&amp;mid=2247484135&amp;idx=1&amp;sn=75b15f19b536aa872c74b119c8ef8456&amp;chksm=90369880a7411196e3b266c7bafbb88ca5429ec46e2192988aa32fbba08eea527d87ffd357f8&amp;cur_album_id=3177419152429514755&amp;scene=189#wechat_redirect" target="_blank" rel="noreferrer">Windows系统的开源替代版—ReactOS (qq.com)</a></p><h2 id="fastfetch-查看系统所有配置-支持所有系统" tabindex="-1">Fastfetch：查看系统所有配置,支持所有系统 <a class="header-anchor" href="#fastfetch-查看系统所有配置-支持所有系统" aria-label="Permalink to &quot;Fastfetch：查看系统所有配置,支持所有系统&quot;">​</a></h2><p><strong>GitHub开源地址</strong>：<a href="https://github.com/fastfetch-cli/fastfetch" target="_blank" rel="noreferrer">https://github.com/fastfetch-cli/fastfetch</a></p><h3 id="项目介绍" tabindex="-1">项目介绍 <a class="header-anchor" href="#项目介绍" aria-label="Permalink to &quot;项目介绍&quot;">​</a></h3><blockquote><p>Fastfetch 是一个类似于 neofetch 的命令行工具，旨在快速获取系统信息并以美观的方式展示。它采用主要由 C 编写，注重性能和可定制性。目前支持 Linux、Android、FreeBSD、macOS 和 Windows 7+ 等操作系统。</p></blockquote><p><img src="'+l+'" alt="图片"></p><p><img src="'+o+'" alt="图片"></p><h3 id="功能特点" tabindex="-1">功能特点 <a class="header-anchor" href="#功能特点" aria-label="Permalink to &quot;功能特点&quot;">​</a></h3><ul><li>1.<strong>快速性能</strong>：由于主要使用 C 语言编写，Fastfetch 相较于 neofetch 更快速地获取和展示系统信息。</li><li>2.<strong>多平台支持</strong>：Fastfetch 在 Linux、Android、FreeBSD、macOS 和 Windows 7+ 等多种操作系统上均得到支持，提供跨平台的功能。</li><li>3.<strong>信息展示</strong>：Fastfetch 可以展示操作系统、Shell、内核、CPU、GPU、内存等关键信息，让用户快速了解系统环境。</li><li>4.<strong>可定制性</strong>：用户可以根据自己的需求定制和调整 Fastfetch 的展示信息，使其更符合个人偏好。</li></ul><h3 id="安装使用" tabindex="-1">安装使用 <a class="header-anchor" href="#安装使用" aria-label="Permalink to &quot;安装使用&quot;">​</a></h3><h4 id="linux" tabindex="-1">Linux <a class="header-anchor" href="#linux" aria-label="Permalink to &quot;Linux&quot;">​</a></h4><ul><li><strong>Debian / Ubuntu：</strong> 在 Github 发布页面下载<code>fastfetch-linux-&lt;proper architecture&gt;.deb</code> 安装文件，进行安装。</li><li><strong>Arch Linux：</strong> 可通过 <code>sudo pacman -S fastfetch</code> 安装 Fastfetch。</li><li><strong>Fedora：</strong> 使用 <code>sudo dnf install fastfetch</code> 命令安装 Fastfetch。</li><li><strong>其他发行版：</strong> 用户可以参考各个发行版对 Fastfetch 的支持情况，或者通过 linuxbrew 进行安装。</li></ul><h4 id="macos" tabindex="-1">macOS <a class="header-anchor" href="#macos" aria-label="Permalink to &quot;macOS&quot;">​</a></h4><ul><li><strong>HomeBrew：</strong> 通过 HomeBrew 使用 <code>brew install fastfetch</code> 命令进行安装。</li><li><strong>MacPorts：</strong> 通过 MacPorts 使用 <code>sudo port install fastfetch</code> 进行安装。</li></ul><h4 id="windows" tabindex="-1">Windows <a class="header-anchor" href="#windows" aria-label="Permalink to &quot;Windows&quot;">​</a></h4><ul><li><strong>Scoop：</strong> 使用 <code>scoop install fastfetch</code> 命令通过 Scoop 包管理器安装 Fastfetch。</li></ul><h4 id="freebsd" tabindex="-1">FreeBSD <a class="header-anchor" href="#freebsd" aria-label="Permalink to &quot;FreeBSD&quot;">​</a></h4><ul><li>使用 <code>pkg install fastfetch</code> 命令进行 Fastfetch 的安装。</li></ul><h4 id="android-termux" tabindex="-1">Android (Termux) <a class="header-anchor" href="#android-termux" aria-label="Permalink to &quot;Android (Termux)&quot;">​</a></h4><ul><li>通过 <code>pkg install fastfetch</code> 命令通过 Termux 包管理器安装 Fastfetch。</li></ul><blockquote><p>总之，Fastfetch 是一个高性能的系统信息获取工具，通过其快速和可定制的特性，可以帮助用户快速了解并展示系统信息。无论是在 Linux、macOS、Windows 还是其他支持的系统平台上, 都可以快速获取系统配置信息.</p></blockquote><h1 id="c语言游戏引擎" tabindex="-1">C语言游戏引擎 <a class="header-anchor" href="#c语言游戏引擎" aria-label="Permalink to &quot;C语言游戏引擎&quot;">​</a></h1><h2 id="mojoc-跨平台、开源、纯-c-编写的手机游戏引擎" tabindex="-1">Mojoc：跨平台、开源、纯 C 编写的手机游戏引擎 <a class="header-anchor" href="#mojoc-跨平台、开源、纯-c-编写的手机游戏引擎" aria-label="Permalink to &quot;Mojoc：跨平台、开源、纯 C 编写的手机游戏引擎&quot;">​</a></h2><p>GitHub：<a href="https://github.com/scottcgi/Mojoc" target="_blank" rel="noreferrer">scottcgi/Mojoc：一款跨平台、开源、纯 C 游戏引擎，用于移动游戏。 (github.com)</a></p><p>一个跨平台、开源、纯 C 游戏引擎，用于手机游戏。</p><h1 id="开源的游戏模拟器" tabindex="-1">开源的游戏模拟器 <a class="header-anchor" href="#开源的游戏模拟器" aria-label="Permalink to &quot;开源的游戏模拟器&quot;">​</a></h1><h2 id="游戏模拟器" tabindex="-1">游戏模拟器 <a class="header-anchor" href="#游戏模拟器" aria-label="Permalink to &quot;游戏模拟器&quot;">​</a></h2><p>游戏模拟器是允许玩家在原本不支持的设备上体验游戏的强大工具。无论是经典的复古游戏，还是现代的游戏控制台独占游戏，模拟器都打开了新的可能性，使得跨平台游玩成为现实。下面是三款不同模拟器的详细介绍，帮助您更深入地了解每款模拟器的特性与使用方法。</p><h2 id="ryujinx模拟器" tabindex="-1">Ryujinx模拟器 <a class="header-anchor" href="#ryujinx模拟器" aria-label="Permalink to &quot;Ryujinx模拟器&quot;">​</a></h2><p><img src="'+a+'" alt="图片"></p><p>Ryujinx是一款非常受欢迎的任天堂Switch模拟器。它的开发语言是C#，这使得跨平台兼容成为可能，同时开源的特性也吸引了广大的开发者和玩家共同贡献和完善。</p><h3 id="特点" tabindex="-1">特点 <a class="header-anchor" href="#特点" aria-label="Permalink to &quot;特点&quot;">​</a></h3><ul><li>支持多种输入设备，包括键盘和游戏手柄。</li><li>支持保存游戏进度，包括游戏状态保存和读取。</li><li>支持高清游戏画面和调整帧率，提升游戏体验。</li><li>定期更新以改善兼容性和性能。</li><li>支持自定义设置，玩家可以根据自己的喜好调整模拟器。</li></ul><h3 id="兼容性" tabindex="-1">兼容性 <a class="header-anchor" href="#兼容性" aria-label="Permalink to &quot;兼容性&quot;">​</a></h3><p>模拟器支持运行的平台有：Windows、MacOS、Linux平台。</p><p>Ryujinx 已在约 4,200 款游戏上进行了测试；超过 4,150 个启动菜单并进入游戏，其中大约 3,500 个被认为可以玩。</p><p>官方网站：</p><div class="language- line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki one-dark-pro vp-code" tabindex="0"><code><span class="line"><span>https://www.ryujinx.org/</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>使用指南：</p><div class="language- line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki one-dark-pro vp-code" tabindex="0"><code><span class="line"><span>https://github.com/Ryujinx/Ryujinx/wiki/Ryujinx-Setup-&amp;-Configuration-Guide</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h2 id="suyu模拟器" tabindex="-1">Suyu模拟器 <a class="header-anchor" href="#suyu模拟器" aria-label="Permalink to &quot;Suyu模拟器&quot;">​</a></h2><p><img src="'+s+'" alt="image-20240508190250881"></p><p>Suyu模拟器是基于于另一款知名的Nintendo Switch模拟器yuzu。由于yuzu项目的停止更新，Suyu模拟器作为其继承者，被开发出来继续提供服务。</p><h3 id="特性" tabindex="-1">特性 <a class="header-anchor" href="#特性" aria-label="Permalink to &quot;特性&quot;">​</a></h3><ul><li>它进行了优化，提高了游戏性能和兼容性。</li><li>支持图形提升，如分辨率缩放和反锯齿。</li><li>支持直接在智能手机上运行Nintendo Switch游戏，这对于移动游戏玩家来说是一大福音。</li></ul><p>模拟器支持运行的平台有：Windows、MacOS、Linux、Android、IOS。</p><h3 id="社区支持" tabindex="-1">社区支持 <a class="header-anchor" href="#社区支持" aria-label="Permalink to &quot;社区支持&quot;">​</a></h3><p>Suyu模拟器依然维持开源状态，玩家和开发者可以通过项目地址访问源代码，参与到改进和维护工作中。</p><p>项目地址：</p><div class="language- line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki one-dark-pro vp-code" tabindex="0"><code><span class="line"><span>https://git.suyu.dev/suyu/suyu</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h2 id="openemu模拟器" tabindex="-1">openemu模拟器 <a class="header-anchor" href="#openemu模拟器" aria-label="Permalink to &quot;openemu模拟器&quot;">​</a></h2><p><img src="'+n+'" alt="图片"></p><p>openemu则是专为macOS用户设计的复古游戏模拟器。它以其精致的用户界面和易于使用的功能而被广大macOS用户所喜爱。</p><h3 id="主要功能" tabindex="-1">主要功能 <a class="header-anchor" href="#主要功能" aria-label="Permalink to &quot;主要功能&quot;">​</a></h3><ul><li>它有一个集成的游戏库管理系统，让玩家轻松地整理和浏览游戏集。</li><li>支持多达多个不同控制器的自动设置，简化游戏配置。</li><li>提供屏幕滤镜和游戏手柄支持，增强复古游戏体验。</li></ul><h3 id="支持的游戏系统" tabindex="-1">支持的游戏系统 <a class="header-anchor" href="#支持的游戏系统" aria-label="Permalink to &quot;支持的游戏系统&quot;">​</a></h3><p>openemu支持广泛的复古游戏系统，从老式的NES和SNES到GBA，甚至Sony的PlayStation和PSP都可在这一平台上找到仿真的可能。</p><p>支持系统列表：</p><div class="language- line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki one-dark-pro vp-code" tabindex="0"><code><span class="line"><span>https://github.com/OpenEmu/OpenEmu/wiki#supported-systems</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h3 id="获取与安装" tabindex="-1">获取与安装 <a class="header-anchor" href="#获取与安装" aria-label="Permalink to &quot;获取与安装&quot;">​</a></h3><p>玩家可以前往openemu的官网下载安装程序，一键安装后，只需简单设置即可开始游玩。</p><p>官网地址：</p><div class="language- line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki one-dark-pro vp-code" tabindex="0"><code><span class="line"><span>https://openemu.org/</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>项目地址：</p><div class="language- line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki one-dark-pro vp-code" tabindex="0"><code><span class="line"><span>https://github.com/OpenEmu</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><hr><p>以上是对游戏模拟器的详细介绍。这些工具不仅为游戏爱好者提供了无限的便利，也在一定程度上保存了游戏文化的遗产。通过模拟器，我们能够左右穿梭于不同的游戏时代，享受多元化的游戏体验。</p><h1 id="c-学习资源" tabindex="-1">C++学习资源 <a class="header-anchor" href="#c-学习资源" aria-label="Permalink to &quot;C++学习资源&quot;">​</a></h1><p>C++ 是一种低级系统编程语言，通常用于游戏、操作系统、驱动程序和嵌入式系统等性能关键型应用程序。</p><p>以下是有关 C++ 及其常见用例的关键知识：</p><ul><li>C++是一种高效、灵活、低级的通用编程语言。它于 1979 年作为 C 语言的扩展而开发。</li><li>C++ 支持过程式、面向对象和泛型编程。它具有类、继承、模板、异常等功能。</li><li>C++ 代码通常被编译为机器代码以获得最大性能。它允许直接访问内存，这使其适合系统编程。</li><li>C++ 的一些主要用例包括系统编程、游戏开发、嵌入式系统、桌面应用程序等。</li><li>系统编程——C++ 由于其效率和低级访问而被广泛用于开发操作系统、数据库、编译器、设备驱动程序。</li><li>游戏开发——大多数 AAA 游戏都是使用 C++ 开发的，因为它具有高性能和与图形库交互的能力。</li><li>嵌入式系统 — C++ 由于其低级功能而通常用于对微控制器、硬件、固件进行编程。</li><li>桌面应用程序 — C++ 与 Qt、wxWidgets 允许为 Windows、Linux 构建高性能桌面应用程序。</li><li>后端开发 — C++ 因其效率而为许多 Web 服务器和网络应用程序提供支持。</li><li>科学/数值计算——Boost 和 Eigen 等库使 C++ 非常适合科学和工程任务。</li></ul><p><a href="https://learnmoderncpp.com/" target="_blank" rel="noreferrer">学习现代 C++ – 发现符合当今计算需求的语言 (learnmoderncpp.com)</a></p><h2 id="一、基础" tabindex="-1">一、基础 <a class="header-anchor" href="#一、基础" aria-label="Permalink to &quot;一、基础&quot;">​</a></h2><h3 id="_1-1-一个项目入门-c-足以-cplusplusthings" tabindex="-1">1.1 一个项目入门 C++ 足以：CPlusPlusThings <a class="header-anchor" href="#_1-1-一个项目入门-c-足以-cplusplusthings" aria-label="Permalink to &quot;1.1 一个项目入门 C++ 足以：CPlusPlusThings&quot;">​</a></h3><p>CPlusPlusThings 是国人开源一个 C++ 学习项目。它系统地将 C++ 学习分为了【基础进阶】、【实战系列】、【C++2.0 新特性】、【设计模式】和【STL 源码剖析】、【并发编程】、【C++ 惯用法】、【学习课程】、【工具】、【拓展】。</p><p>作为一个全面系统的 C++ 学习项目，CPlusPlusThings 是优秀的，它合理地安排了 10 Days 的实战部分，在实战中了解语法和函数用法，唯一不足的是，在注释部分有些不尽人意，对部分新手程序员并不是很友好。【基础进阶】部分内容：</p><ul><li>const 那些事</li><li>static 那些事</li><li>decltype 那些事</li><li>引用与指针那些事</li><li>宏那些事</li></ul><blockquote><p>GitHub 地址→<a href="https://github.com/Light-City/CPlusPlusThings" target="_blank" rel="noreferrer">https://github.com/Light-City/CPlusPlusThings</a></p></blockquote><h3 id="_1-2-基础部分之算法-c-plus-plus" tabindex="-1">1.2 基础部分之算法：C-Plus-Plus <a class="header-anchor" href="#_1-2-基础部分之算法-c-plus-plus" aria-label="Permalink to &quot;1.2 基础部分之算法：C-Plus-Plus&quot;">​</a></h3><p>C-Plus-Plus 是收录用 C++ 实现的各种算法的集合，并按照 MIT 许可协议进行授权。这些算法涵盖了计算机科学、数学和统计学、数据科学、机器学习、工程等各种主题。除外，你可能会发现针对同一目标的多个实现使用不同的算法策略和优化。</p><blockquote><p>GitHub 地址→<a href="https://github.com/TheAlgorithms/C-Plus-Plus" target="_blank" rel="noreferrer">https://github.com/TheAlgorithms/C-Plus-Plus</a></p></blockquote><h2 id="二、进阶" tabindex="-1">二、进阶 <a class="header-anchor" href="#二、进阶" aria-label="Permalink to &quot;二、进阶&quot;">​</a></h2><h3 id="_2-1-现代-c-modern-cpp-tutorial" tabindex="-1">2.1 现代 C++：modern-cpp-tutorial <a class="header-anchor" href="#_2-1-现代-c-modern-cpp-tutorial" aria-label="Permalink to &quot;2.1 现代 C++：modern-cpp-tutorial&quot;">​</a></h3><p>modern-cpp-tutorial 是现代 C++ 教程，它的目的是提供关于现代 C++（2020 年前）的相关特性的全面介绍。除了介绍了代码之外，它还尽可能简单地介绍了其技术需求的历史背景，这对理解为什么会出现这些特性提供了很大的帮助。</p><blockquote><p>GitHub 地址→<a href="https://github.com/changkun/modern-cpp-tutorial" target="_blank" rel="noreferrer">https://github.com/changkun/modern-cpp-tutorial</a></p></blockquote><p><img src="'+a+'" alt="图片"></p><h3 id="_2-2-进阶指南-cpptemplatetutorial" tabindex="-1">2.2 进阶指南：CppTemplateTutorial <a class="header-anchor" href="#_2-2-进阶指南-cpptemplatetutorial" aria-label="Permalink to &quot;2.2 进阶指南：CppTemplateTutorial&quot;">​</a></h3><p>CppTemplateTutorial 为中文的 C++ Template 的教学指南。与知名书籍 C++ Templates 不同，该系列教程将 C++ Templates 作为一门图灵完备的语言来讲授，以求帮助读者对 Meta-Programming 融会贯通。本项目写作初衷，就是通过 “编程语言” 的视角，介绍一个简单、清晰的 “模板语言”。我会尽可能地将模板的诸多要素连串起来，用一些简单的例子帮助读者学习这门 “语言”，让读者在编写、阅读模板代码的时候，能像 <code>if(exp) { dosomething(); }</code> 一样的信手拈来，让 “模板元编程” 技术成为读者牢固掌握、可举一反三的有用技能。</p><p>适合熟悉 C++ 的基本语法、使用过 STL、熟悉一些常用的算法，以及递归等程序设计方法的 C++ 学习者阅读。虽然项目章节文章写的深入浅出，不过唯一的遗憾是尚未完成所有章节内容。进度如下：</p><ul><li>0.前言</li><li>1.Template 的基本语法</li><li>2.模板元编程基础</li><li>3.深入理解特化与偏特化</li><li>4.元编程下的数据结构与算法 （尚未开始）</li><li>5.模板的进阶技巧（尚未开始）</li><li>6.模板的威力：从 foreach, transform 到 Linq（尚未开始）</li><li>7.结语：讨论有益，争端无用（尚未开始）</li></ul><blockquote><p>GitHub 地址→<a href="https://github.com/wuye9036/CppTemplateTutorial" target="_blank" rel="noreferrer">https://github.com/wuye9036/CppTemplateTutorial</a></p></blockquote><h2 id="三、动手实战" tabindex="-1">三、动手实战 <a class="header-anchor" href="#三、动手实战" aria-label="Permalink to &quot;三、动手实战&quot;">​</a></h2><h3 id="_3-1-来实践一下-mytinystl" tabindex="-1">3.1 来实践一下：MyTinySTL <a class="header-anchor" href="#_3-1-来实践一下-mytinystl" aria-label="Permalink to &quot;3.1 来实践一下：MyTinySTL&quot;">​</a></h3><p>当你学习完 C++ 的“书本”知识后，是不是有些手痒了呢？MyTinySTL 这个注释详细、实践夯实基础的项目便是你 C++ 学习之旅的下一站。作为新手练习用途，MyTinySTL 的作者 Alinshans 用 C++11 重新复写了一个小型 STL（容器库＋算法库）。代码结构清晰规范、包含中文文档与注释，并且自带一个简单的测试框架，适合 C++ 新手来实践一番。</p><blockquote><p>GitHub 地址→<a href="https://github.com/Alinshans/MyTinySTL" target="_blank" rel="noreferrer">https://github.com/Alinshans/MyTinySTL</a></p></blockquote><h3 id="_3-2-重温同年俄罗斯方块-tinytetris" tabindex="-1">3.2 重温同年俄罗斯方块：Tinytetris <a class="header-anchor" href="#_3-2-重温同年俄罗斯方块-tinytetris" aria-label="Permalink to &quot;3.2 重温同年俄罗斯方块：Tinytetris&quot;">​</a></h3><p>Tinytetris 是一个用 C++ 编写的终端版俄罗斯方块游戏。它提供了两个版本的源码，分为注释版和库版，注释较多易于理解和学习。</p><blockquote><p>GitHub 地址→<a href="https://github.com/taylorconor/tinytetris" target="_blank" rel="noreferrer">https://github.com/taylorconor/tinytetris</a></p></blockquote><p><img src="'+c+'" alt="图片"></p><h3 id="_3-3-学习下大佬们的代码-calculator" tabindex="-1">3.3 学习下大佬们的代码：calculator <a class="header-anchor" href="#_3-3-学习下大佬们的代码-calculator" aria-label="Permalink to &quot;3.3 学习下大佬们的代码：calculator&quot;">​</a></h3><p>微软开源的 Windows 系统预装的计算器工具。该工具提供标准、科学、程序员计算器的功能，以及各种度量单位和货币之间的转换功能。快来看看微软工程师编写的代码吧！学习大厂的编码规范、项目结构之类的，提高阅读源码的能力。英文的项目且没有讲解部分，需要通过阅读源码学习，难度较高。</p><blockquote><p>GitHub 地址→<a href="https://github.com/microsoft/calculator" target="_blank" rel="noreferrer">https://github.com/microsoft/calculator</a></p></blockquote><p><img src="'+p+'" alt="图片"></p>',114),d=[u];function b(m,f,g,C,q,k){return r(),t("div",null,d)}const P=e(h,[["render",b]]);export{_ as __pageData,P as default};
